import React,{Component} from 'react'

class TodoItem extends Component{
    constructor(props){
        super(props)
        this.doDel = this.doDel.bind(this)
    }

    doDel(k){
        console.log('do del');
        console.log(this.props.keyindex);
        this.props.itemDel(this.props.keyindex)
    }

    render(){
        console.log('TodoItem render :' + this.props.keyindex);
        return <li onClick={()=>{this.doDel(this.props.keyindex)}}>
            {this.props.val}
            {this.props.keyindex}
            </li>
    }
}
export default TodoItem
